import React from "react";

const CityInput = props => (
  <form>
    <input
      type="text"
      onClick={this.props.userCity}
      placeholder="where do you live?"
    />
    <button type="submit" value="submit">
      enter
    </button>
  </form>
);

export default CityInput;
